module.exports = "<!--Authored by Aparna Sridhar[B00799570]-->\n<div class=\"mt-85\">\n<div class= \"container\"> \n  <br> \n  <h3 style=\"color: #2196F3\"><strong> Why should you rescue a pet?</strong> </h3>\n  <h6>Here are some reasons why you should!!!</h6>\n  <div id= \"one\" class=\"row\">\n  <div class=\"col-md-4\">\n    <!-- Examples from material design for angular https://mdbootstrap.com-->\n    <mdb-card class= \"cards\" narrower =\"true\">\n      <div class=\"view view-cascade overlay waves-light\" mdbWavesEffect>\n        <mdb-card-img src=\"https://d31j74p4lpxrfp.cloudfront.net/sites/default/files/styles/mobile_large_image/public/int_files/1014540-dog_on_beach-large.jpg?itok=xQezocmm\"></mdb-card-img>\n        <a>\n          <div class=\"mask rgba-white-slight\"></div>\n        </a>\n      </div>\n      <mdb-card-body cascade=\"true\" class=\"text-center\">\n        <h4 class=\"card-title\">\n          <strong>Strayed Dogs in Canada</strong>\n        </h4>\n      <!-- Texts used from https://www.humanesociety.org/resources/top-reasons-adopt-pet-->\n        <mdb-card-text>\n            Each year, 2.7 million adoptable dogs and cats are euthanized in the United States, simply because too many pets come into shelters and too few people consider adoption when looking for a pet.\n            The number of euthanized animals could be reduced dramatically if more people adopted pets instead of buying them. When you adopt, you save a loving animal by making them part of your family and open up shelter space for another animal who might desperately need it.\n        </mdb-card-text>\n            </mdb-card-body>\n      <!--/Card content-->\n\n    </mdb-card>\n    <!--Card-->\n  </div>\n\n  <div class=\"col-md-4\">\n    <!--Card-->\n    <mdb-card cascade=\"true\" narrower=\"true\">\n\n      <!--Card image-->\n      <div class=\"view view-cascade overlay waves-light\" mdbWavesEffect>\n        <mdb-card-img src=\"https://www.mercurynews.com/wp-content/uploads/2016/08/20140127_055618_KRTC_CA-FERALCATS_3_CC.jpg?w=620\"></mdb-card-img>\n        <a>\n          <div class=\"mask rgba-white-slight\"></div>\n        </a>\n      </div>\n      <!--/Card image-->\n\n      <mdb-card-body cascade=\"true\" class=\"text-center\">\n        <!--Card content-->\n        <h4 class=\"card-title\">\n          <strong>Strayed Cats in Canada</strong>\n        </h4>\n      <!-- Texts generated from https://www.humanesociety.org/resources/top-reasons-adopt-pet-->\n        <mdb-card-text>\n            Animal shelters and rescue groups are brimming with happy, healthy pets just waiting for someone to take them home. Most shelter pets wound up there because of a human problem like a move or a divorce, not because the animals did anything wrong. Many are already house-trained and used to living with families.\n        </mdb-card-text>\n\n      </mdb-card-body>\n      <!--/Card content-->\n\n    </mdb-card>\n    <!--/.Card-->\n  </div>\n\n  <div class=\"col-md-4\">\n    <!--Card-->\n    <mdb-card cascade=\"true\" narrower=\"true\">\n\n      <!--Card image-->\n      <div class=\"view view-cascade overlay waves-light\" mdbWavesEffect>\n        <mdb-card-img src=\"https://www.rover.com/blog/wp-content/uploads/2017/07/rescue-intros-header-960x540.jpg\"></mdb-card-img>\n        <a>\n          <div class=\"mask rgba-white-slight\"></div>\n        </a>\n      </div>\n      <!--/Card image-->\n\n      <mdb-card-body cascade=\"true\" class=\"text-center\">\n        <!--Card content-->\n        <h4 class=\"card-title\">\n          <strong>Why should you rescue?</strong>\n        </h4>\n        <h5>Because you'll save a life</h5>\n        <!-- Texts generated from https://www.humanesociety.org/resources/top-reasons-adopt-pet-->\n        <mdb-card-text>\n          <p>Usually when you adopt a pet, the cost of spay/neuter, first vaccinations (and sometimes even microchipping!) is included in the adoption price, which can save you some of the up front costs of adding a new member to your family. Depending on the animal, you may also save on housebreaking and training expenses.\n          <p> No one needs to see another selfie—unless it’s a selfie of you with the adorable pet you just adopted! Adopt a pet, post those pictures and let the well-earned likes roll in.</p>\n        </mdb-card-text>\n\n      </mdb-card-body>\n      <!--/.Card content-->\n\n    </mdb-card>\n    <!--/.Card-->\n  </div>\n</div>\n<!-- Next row begins here-->\n<div id= \"two\" class=\"row\">\n  <div class=\"col-md-4\">\n    <mdb-card class= \"cards\" narrower =\"true\">\n      <div class=\"view view-cascade overlay waves-light\" mdbWavesEffect>\n        <mdb-card-img src=\"https://d31j74p4lpxrfp.cloudfront.net/sites/default/files/styles/mobile_large_image/public/int_files/1014540-dog_on_beach-large.jpg?itok=xQezocmm\"></mdb-card-img>\n        <a>\n          <div class=\"mask rgba-white-slight\"></div>\n        </a>\n      </div>\n      <mdb-card-body cascade=\"true\" class=\"text-center\">\n        <h4 class=\"card-title\">\n          <strong>Strayed Dogs in Canada</strong>\n        </h4>\n      <!-- Texts generated from https://www.humanesociety.org/resources/top-reasons-adopt-pet-->\n        <mdb-card-text>\n            If you buy a dog from a pet store,online seller or flea market, you’re almost certainly getting a dog from a puppy mill.        </mdb-card-text>\n      </mdb-card-body>\n      <!--/.Card content-->\n\n    </mdb-card>\n    <!--/.Card-->\n  </div>\n\n  <div class=\"col-md-4\">\n    <!--Card-->\n    <mdb-card cascade=\"true\" narrower=\"true\">\n\n      <!--Card image-->\n      <div class=\"view view-cascade overlay waves-light\" mdbWavesEffect>\n        <mdb-card-img src=\"https://www.mercurynews.com/wp-content/uploads/2016/08/20140127_055618_KRTC_CA-FERALCATS_3_CC.jpg?w=620\"></mdb-card-img>\n        <a>\n          <div class=\"mask rgba-white-slight\"></div>\n        </a>\n      </div>\n      <!--/Card image-->\n\n      <mdb-card-body cascade=\"true\" class=\"text-center\">\n        <!--Card content-->\n        <h4 class=\"card-title\">\n          <strong>Strayed Cats in Canada</strong>\n        </h4>\n      <!-- Texts generated from https://www.humanesociety.org/resources/top-reasons-adopt-pet-->\n        <mdb-card-text>\n            Puppy mills are factory-style breeding facilities that put profit above the welfare of dogs. Animals from puppy mills are housed in shockingly poor conditions with improper medical care, and are often very sick and behaviorally troubled as a result. The moms of these puppies are kept in cages to be bred over and over for years, without human companionship and with little hope of ever joining a family. And after they're no longer profitable, breeding dogs are simply discarded—either killed, abandoned or sold at auction\n        </mdb-card-text>\n\n      </mdb-card-body>\n      <!--/.Card content-->\n\n    </mdb-card>\n    <!--/.Card-->\n  </div>\n\n  <div class=\"col-md-4\">\n    <!--Card-->\n    <mdb-card cascade=\"true\" narrower=\"true\">\n\n      <!--Card image-->\n      <div class=\"view view-cascade overlay waves-light\" mdbWavesEffect>\n        <mdb-card-img src=\"https://www.rover.com/blog/wp-content/uploads/2017/07/rescue-intros-header-960x540.jpg\"></mdb-card-img>\n        <a>\n          <div class=\"mask rgba-white-slight\"></div>\n        </a>\n      </div>\n      <!--/Card image-->\n\n      <mdb-card-body cascade=\"true\" class=\"text-center\">\n        <!--Card content-->\n        <h4 class=\"card-title\">\n          <strong>Why should you rescue?</strong>\n        </h4>\n        <h5>Because you'll save a life</h5>\n<!-- Texts generated from loremipsum.io-->\n        <mdb-card-text>\n          <p>These puppy mills continue to stay in business through deceptive tactics — their customers are unsuspecting consumers who shop in pet stores, over the Internet or through classified ads. Puppy mills will continue to operate until people stop supporting them. By adopting a pet, you can be certain you aren't giving them a dime.</p>\n          <p> Many of the pets from shelters and rescues are already house-trained, which means you’re not only saving a pet’s life, you may be saving your rug. Adopting a mature pet not only gives older animals a second chance, it often means introducing them to your family will be much easier.</p>\n        </mdb-card-text>\n\n      </mdb-card-body>\n      <!--/.Card content-->\n\n    </mdb-card>\n    <!--/.Card-->\n  </div>\n</div>\n</div>\n</div>"

