module.exports = "<!--Developer - Dheeraj Varshney B00808467 dh301823@dal.ca-->\n<div id=\"dogDiv\" class=\"mt-85\">\n\n  <div class=\"container-fluid\">\n    <h2 class=\"header1\"> Why Adopt a Dog</h2>\n    <div class=\"row\">\n      <div class=\"col-lg-5\">\n          <!--https://bestfriends.org/resources/reasons-adopt-pet -->\n        <img class=\"img-fluid rounded \" id=\"dog1\" src=\"./assets/images/WhyDogImages/whydog_4.jpg\">\n        <div class=\"imgeffect\">Read my story</div>\n      </div>\n      <div class=\"col-lg-7\">\n        <ul>\n          <li><span class=\"boldtext\">Buying a pet can easily cost $500 to $1,000 or more.</span>\n            Adoption costs range from $50 to $200, depending on\n            whether the pet comes from the city shelter or a rescue group that has spent money on boarding, vets and\n            grooming.\n          </li>\n          <li><span class=\"boldtext\">You’re getting more for your money if you get a mixed breed.</span>\n            Based on the well-established principle of\n            “hybrid vigor,” a mixed-breed animal is likely to live longer and cost less in vet bills than a pure breed.\n          </li>\n          <li><span class=\"boldtext\">Many purebred dogs are prone to developing health problems ranging from breathing\n            difficulties to hip dysplasia to an enlarged heart.</span>\n          </li>\n        </ul>\n      </div>\n    </div>\n\n    <div class=\"row\">\n      <div class=\"col-lg-5\">\n        <!--https://bestfriends.org/resources/reasons-adopt-pet -->\n        <img class=\"img-fluid rounded \" id=\"dog2\" src=\"./assets/images/WhyDogImages/whydog_3.jpg\">\n        <div class=\"imgeffect\">Read my story</div>\n      </div>\n      <div class=\"col-lg-7\">\n        <ul>\n          <li><span class=\"boldtext\"> When you adopt a pet, you are saving a life.</span> When you buy a pet, you not only deny\n            a homeless pet a home, you are supporting an industry that thrives on short-changing the welfare of\n            animals. Puppy and kitten mills (which sell to pet stores) are in business to make a profit, so they churn\n            out puppies and kittens as fast as they can. </li>\n            <li><span class=\"boldtext\">These animals are often in ill-health and have problems like poor socialization\n            skills due to lack of human companionship and genetic defects due to inbreeding.</span> </li>\n            <li><span class=\"boldtext\">If you adopt, you get your choice of any age.</span> Though puppies and kittens are cute\n            and cuddly, they can also be a handful. An adult or older pet may be a better fit for you. For example,\n            adopting an adult dog who’s already house-trained and knows basic cues is often much easier than adopting a\n            puppy, who must be taught these things.</li>\n            <li><span class=\"boldtext\">You get just as much love (if not more).</span> An adopted pet is every bit as loving,\n            intelligent and loyal as a purchased pet, even if you get an adult or older animal.</li>\n        </ul>\n      </div>\n    </div>\n  </div>\n</div>"

